import Vue from 'vue'
import VueRouter from 'vue-router'
import login from '../components/AppLogin.vue'
import index from '../components/AppIndex.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'login',
    component: login
  },
  {
    path: '/index',
    name: 'index',
    component: index
  }
]

const router = new VueRouter({
  routes
})

export default router
